import{
    BrowserRouter as Router,
    Route, 
    Routes,
    Navigate
}from "react-router-dom"
import Login from './ConpoLogin/Login';
import Homepage from "./pages/Homepage";

function AppRouter (){
    return(
        <Router>
            <Routes>
                <Route  path="/login" exact element={Login}/>
            </Routes>

        </Router>
    )
}
export default AppRouter;
